import React, { Component } from 'react';
import "./NavBar.css";
import Grid from '@material-ui/core/Grid';
import fblogo from "../../images/logo.png";
import home from "../../images/home.svg";
import page from "../../images/pages.svg";
import watch from "../../images/watch.svg";
import market from "../../images/market.svg";
import group from "../../images/groups.svg";
import notification from "../../images/notification.svg";
import messenger from "../../images/messenger.svg";
import arrow from "../../images/arrow.svg";
import { Avatar } from '@material-ui/core';

class NavBar extends Component {
    constructor(props) {
        super(props);
        this.state = {  }   
    }
    render() { 
        return ( 
            <div>
                <Grid container className="navbar__main">
                    <Grid item xs ={3}>
                        <div className="navbar__leftbar">
                            <img className="navbar__logo" src={fblogo} width="40px"/>
                            <input className="navbar__search" type="text" placeholder="Search Facebook" />
                        </div>
                    </Grid>
                    <Grid item xs ={6}>
                        <div className="navbar__container">
                            <div className="navbar__tabs active">
                                <img src={home} height="35px" width="35px" />
                            </div>
                            <div className="navbar__tabs">
                                <img src={page} height="35px" width="35px" />
                            </div>
                            <div className="navbar__tabs">
                                <img src={watch} height="35px" width="35px" />
                            </div>
                            <div className="navbar__tabs">
                                <img src={market} height="35px" width="35px" />
                            </div>
                            <div className="navbar__tabs">
                                <img src={group} height="35px" width="35px" />
                            </div>
                        </div>
                    </Grid>
                    <Grid item xs ={3}>
                        <div className="navbar__right">
                            <div className="navbar__righttab"> 
                                <Avatar className="navbar__rightimg" src="https://scontent.fblr1-6.fna.fbcdn.net/v/t1.6435-1/p100x100/162713656_4172696726074274_4057600099221701280_n.jpg?_nc_cat=109&ccb=1-3&_nc_sid=7206a8&_nc_ohc=3bDwi8YOtykAX_Notpu&_nc_ht=scontent.fblr1-6.fna&tp=6&oh=9d390181cf11a772e4387880fb0950fe&oe=608CBCEA" />
                                <div className="navbar__profilename">Anindya</div>
                            </div>
                            <div className="righttabs">
                                <Avatar src={notification} height="35px" width="35px"/>
                            </div>
                            <div className="righttabs">
                                <Avatar src={messenger} height="35px" width="35px"/>
                            </div>
                            <div className="righttabs">
                                <Avatar src={arrow} height="35px" width="35px"/>
                            </div>
                        </div>
                    </Grid>
                </Grid>
            </div> 
        );
    }
}

export default NavBar;
